import { useNavigate } from "react-router-dom";

const categories = [
  "Ayurveda",
  "Yoga & Naturopathy",
  "Unani",
  "Siddha",
  "Homeopathy",
];

export default function Home() {
  const navigate = useNavigate();

  return (
    <div className="home">
      <h1>AYUSH Virtual Herbal Garden</h1>
      <div className="grid">
        {categories.map((cat) => (
          <div key={cat} className="category" onClick={() => navigate(`/plants/${cat}`)}>
            {cat}
          </div>
        ))}
      </div>
    </div>
  );
}
